  const fetchUserCompletion = async () => {
    try {
      const response = await axios.get('/api/user/completion');
      setUserCompletion(response.data.completion || 0);
      setCompletedVideos(Array(course.videos.length).fill(false)); // Initialize completed videos
    } catch (error) {
      console.error('Error fetching user completion data:', error);
    }
  };

  // Function to handle marking a video as completed
  const markAsCompleted = async (index) => {
    const updatedCompletion = [...completedVideos];
    updatedCompletion[index] = true; // Mark the video as completed
    setCompletedVideos(updatedCompletion);
    const completionPercentage = calculateCompletionPercentage();

    // Send updated completion percentage to backend
    await axios.post('/api/user/completion', {
      courseId: courseId,
      completion: completionPercentage,
    });
  };

  // Calculate course completion percentage based on completed videos
  const calculateCompletionPercentage = () => {
    if (course?.videos.length === 0) return 0;
    const completedCount = completedVideos.filter(Boolean).length;
    return Math.round((completedCount / course.videos.length) * 100);
  };

